import React from 'react';
import styled from 'styled-components';
import Home from "./Pages/Home"
import About from "./Pages/About"
import Request from "./Pages/Request"
import Services from "./Pages/Services"
import Header from "./components/Header"
import Footer from "./components/Footer"
import ScrollToTop from "./components/ScrollToTop"
import NotFound from './Pages/NotFound';
import Portfolio from './Pages/Porfolio';
import TermsOfService from "./Pages/TermsOfService"
import './globalStyle.css';
import { Route, Routes } from 'react-router-dom';
import { AnalyticsTracking } from './globalVars';
import ReactGA from 'react-ga4';

const PageHolder = styled.div`
background-color: var(--peach);
`

ReactGA.initialize(AnalyticsTracking)

function App() {
  <script async src="https://www.googletagmanager.com/gtag/js?id=G-F692C7MG6R"></script>
  ReactGA.send({ hitType: "pageview", page: window.location.pathname + window.location.search, title: "Custom Title" });
  //   <script>
  //   window.dataLayer = window.dataLayer || [];
  //   function gtag(){dataLayer.push(arguments);}
  //   gtag('js', new Date());

  //   gtag('config', 'G-F692C7MG6R');
  // </script>
  return (
    <PageHolder>
      <Header />
      <Routes>
        <Route exact path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
        <Route path="/request" element={<Request />} />
        <Route path="/services" element={<Services />} />
        <Route path="/portfolio" element={<Portfolio />} />
        {/* <Route path="/business_website" element={<Home />} /> */}
        <Route path="/terms-of-service" element={<TermsOfService />} />
        <Route path="*" element={<NotFound />} />
      </Routes>
      <Footer />
      <ScrollToTop />
    </PageHolder>
  );
}

export default App;
